import React from 'react';

function Home() {
  return (
    <div>
      <h1>Welcome to My Portfolio</h1>
      <p>Hi, I'm Yo.Raji, a web developer with a passion for creating beautiful and functional websites.</p>
      <p>Explore my projects and services to see what I can do for you!</p>
    </div>
  );
}
export default Home;
